Object.Field:
BEGIN
    UPDATE <%=odiRef.getObjectName("MINTIC_MAESTRAS_TB")%>
    SET BAN_CONSULTA = 0 
    WHERE BAN_CONSULTA = 1;
    COMMIT;
END;

DECLARE
  CURSOR CUR_Beneficiario IS
      SELECT B.ROWID IDT
            ,PE.FEC_ENTREGA_SIMCARD
        FROM <%=odiRef.getObjectName("MINTIC_INFO_PLAN_ENTREGA_TB")%> PE
   LEFT JOIN  <%=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TB")%> UM
               ON PE.NUM_DOC =  (CASE WHEN UM.SK_CATEG_BENEF = 1 
                                      THEN UM.NUM_IDENT_MENOR 
                                 ELSE UM.NUM_DOC 
                                 END)
  LEFT JOIN <%=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB")%> B
               ON PE.NUM_DOC = B.NUM_DOC
              AND (CASE WHEN UM.SK_CATEG_BENEF = 1 
                        THEN UM.NUM_IDENT_MENOR 
                   ELSE UM.NUM_DOC 
                   END) =B.NUM_DOC
              AND PE.MIN = B.MIN
      WHERE UM.BAN_ESTADO_REG=3;


  v_Nro_Registros     PLS_INTEGER;
BEGIN
  v_Nro_Registros := 1;
  FOR Datos IN CUR_Beneficiario LOOP
      UPDATE <%=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB")%>
         SET  FEC_ENTREGA_SIM_CARD = Datos.FEC_ENTREGA_SIMCARD                  
       WHERE ROWID = Datos.IDT    
      ;
      v_Nro_Registros := v_Nro_Registros + 1;

      IF MOD (v_Nro_Registros, 5000) =  0 THEN
        COMMIT;
      END IF;
   -- END IF;
  END LOOP;
  COMMIT;
END;

DECLARE

CONST_Num_Estado_Milla                      CONSTANT NUMBER (1)   := 3;
CONST_Num_Estado_Inicial                    CONSTANT NUMBER (1)   := 5;
CONST_Num_Estado_Env_Logistica              CONSTANT NUMBER (1)   := 8;

CURSOR CUR_Ultima_Milla IS

    SELECT BENEFICIARIO.NUM_DOC NUM_DOC
     FROM <%=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TB")%> MILLA
     JOIN <%=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB")%> BENEFICIARIO
     ON MILLA.NUM_DOC = BENEFICIARIO.NUM_DOC
    WHERE BAN_ESTADO_REG = CONST_Num_Estado_Milla--3
    AND BENEFICIARIO.SK_ESTADO_BENEFI= CONST_Num_Estado_Inicial--5
    ; 
BEGIN

    FOR Datos IN CUR_Ultima_Milla 
         LOOP
           UPDATE <%=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB")%>
            SET SK_ESTADO_BENEFI = CONST_Num_Estado_Env_Logistica
            WHERE NUM_DOC = Datos.NUM_DOC;

        END LOOP;

END;
